import { React, useState } from 'react'
import data from './Listitem.json'
function ListData(props) {
    return (
        <div className='container'>
            <ul>
                {data.map((item) => (
                    <li key={item.id}>{item.text}</li>
                ))}
            </ul>
        </div>
    )
}

export default ListData
